import React from "react";
import {useParams} from "react-router-dom"

const Detail = () => {
    //menggunakan utk menagkap params
    let {id}  = useParams(); 
    let {title}  = useParams(); 
    return (
        <div>
            <h1>Detail</h1>
            <p>ID :{id}</p>
            <p>{title}</p>

        </div>
    )
}

export default Detail
